import React from "react";
import './MiddleText.css';

class MiddleText extends React.Component {
    render() {
        return (
            <div className="Middle-Text">
                <i>
                    ML-based interactive interview prep.
                </i>
                <i>
                    Practice makes perfect.
                </i>
            </div>
        );
    }
}

export default MiddleText;
